import React from 'react';
import Navbar from '../Components/Home/Navbar'
import Content from '../Components/Home/Content';
import { database } from '../data'

console.log(database.name);


const Home = () => {
    return (
        <div>
          <Navbar />
          <Content 
          name={database.name}
          comment={database.comment}
           /> 
        </div>
    );
};

export default Home;
